void drawSprite(uint16_t x,uint16_t y,uint16_t w,uint16_t h, int sprite)
{
//	int i;
//	int j;
//	int point = 0;
//	for(i = 0; i < 50; i++)
//	{
//		for(j = 0; j < 30; j++)
//			LCD_SetPoint(x + 30 - j, y + i, MARIO1[point++]);
//	}
//
	int index = 0;
	int tiled_sprites = 1;
	uint16_t x2 = (x+w-1);
	uint16_t y2 = (y+h-1);
	LCD_SetAddress(y, x, y2, x2);
	uint16_t size = w*h;
	unsigned short *selectedSprite;

	switch (sprite)
	{
	case LOGO:
		selectedSprite = RTOS_LOGO;
		break;
	case PLAYER1:
		selectedSprite = MARIO1;
		break;
	case PLAYER2:

		break;
	case PLAYER3:

		break;
	case JUMP:
		selectedSprite = Jump;
		break;
	case CLOUD1:
		selectedSprite = Cloud1;
		break;
	case CLOUD2:
		selectedSprite = Cloud2;
		break;
	case GROUND:
		selectedSprite = Ground;
		if(w > 12)
		{
			size = 300;
			tiled_sprites = 27;
		}
		break;
	case OBSTACLE1:
		selectedSprite = GOOMBA1;
		if(w > 60)
		{
			size = 900;
			tiled_sprites = 3;
		}
		else if(w > 30)
		{
			size = 900;
			tiled_sprites = 2;
		}
		break;
	}

	WriteTFT_CS(0);
    WriteTFT_DC(1);
	int i,j;
	for(i = 0; i < tiled_sprites; i++)
	{
		for(j = 0; j < size; j++)
		{

			LCD_Write_Data_Only(selectedSprite[j]>>8);
			LCD_Write_Data_Only(selectedSprite[j]);
		}
	}
    WriteTFT_CS(1);
    WriteTFT_DC(1);
}


